// frontend/src/components/Home/Home.js
import React from 'react';
import { 
  Container, 
  Typography, 
  Box, 
  Button, 
  Grid, 
  Card, 
  CardContent,
  useTheme 
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import AccessTimeIcon from '@mui/icons-material/AccessTime';
import AutoGraphIcon from '@mui/icons-material/AutoGraph';
import CalendarMonthIcon from '@mui/icons-material/CalendarMonth';

function Home() {
  const theme = useTheme();
  const navigate = useNavigate();

  const features = [
    {
      icon: <AccessTimeIcon sx={{ fontSize: 40, color: theme.palette.primary.main }} />,
      title: "Smart Scheduling",
      description: "Create the perfect study schedule with our AI-powered system."
    },
    {
      icon: <AutoGraphIcon sx={{ fontSize: 40, color: theme.palette.primary.main }} />,
      title: "Track Progress",
      description: "Monitor your study habits and improve your learning efficiency."
    },
    {
      icon: <CalendarMonthIcon sx={{ fontSize: 40, color: theme.palette.primary.main }} />,
      title: "Easy Planning",
      description: "Manage your academic schedule with our intuitive interface."
    }
  ];

  return (
    <Box sx={{ bgcolor: 'background.default', minHeight: '100vh' }}>
      {/* Hero Section */}
      <Box
        sx={{
          bgcolor: 'secondary.main',
          color: 'white',
          py: 12,
          mb: 8,
          borderBottom: '1px solid rgba(220, 20, 60, 0.2)',
        }}
      >
        <Container maxWidth="md">
          <Box sx={{ 
            textAlign: 'center',
            maxWidth: '800px',
            margin: '0 auto'
          }}>
            <Typography
              variant="h1"
              sx={{
                mb: 3,
                fontSize: { xs: '2.5rem', sm: '3rem', md: '3.5rem' },
                fontWeight: 500,
                letterSpacing: '-0.02em',
                color: '#ffffff'
              }}
            >
              Tempo
            </Typography>
            <Typography
              variant="h2"
              sx={{
                mb: 4,
                fontSize: { xs: '1.25rem', sm: '1.5rem', md: '1.75rem' },
                fontWeight: 400,
                letterSpacing: '0.02em',
                color: 'rgba(255, 255, 255, 0.87)',
                lineHeight: 1.4
              }}
            >
              Optimize your study schedule with AI-powered planning
            </Typography>
            <Box sx={{ 
              display: 'flex', 
              justifyContent: 'center', 
              gap: 2,
              flexWrap: 'wrap' 
            }}>
              <Button
                variant="contained"
                color="primary"
                size="large"
                onClick={() => navigate('/register')}
                sx={{
                  px: 4,
                  py: 1.5,
                  fontSize: '1rem',
                  letterSpacing: '0.02em',
                  fontWeight: 500
                }}
              >
                Get Started
              </Button>
              <Button
                variant="outlined"
                color="inherit"
                size="large"
                onClick={() => navigate('/login')}
                sx={{
                  px: 4,
                  py: 1.5,
                  fontSize: '1rem',
                  letterSpacing: '0.02em',
                  fontWeight: 500
                }}
              >
                Login
              </Button>
            </Box>
          </Box>
        </Container>
      </Box>

      {/* Features Section */}
      <Container maxWidth="lg" sx={{ mb: 12 }}>
        <Typography
          variant="h3"
          align="center"
          sx={{
            mb: 8,
            fontSize: { xs: '1.75rem', sm: '2rem', md: '2.25rem' },
            fontWeight: 500,
            letterSpacing: '-0.01em',
            color: 'text.primary'
          }}
        >
          Why Choose Tempo?
        </Typography>
        <Grid container spacing={4}>
          {features.map((feature, index) => (
            <Grid item xs={12} md={4} key={index}>
              <Card
                sx={{
                  height: '100%',
                  backgroundColor: 'background.paper',
                  transition: 'transform 0.2s ease-in-out',
                  '&:hover': {
                    transform: 'translateY(-4px)'
                  }
                }}
              >
                <CardContent sx={{ p: 4 }}>
                  <Box sx={{ mb: 3 }}>
                    {feature.icon}
                  </Box>
                  <Typography
                    variant="h6"
                    sx={{
                      mb: 2,
                      fontSize: '1.25rem',
                      fontWeight: 500,
                      letterSpacing: '0.02em',
                      color: 'text.primary'
                    }}
                  >
                    {feature.title}
                  </Typography>
                  <Typography
                    variant="body1"
                    sx={{
                      fontSize: '1rem',
                      lineHeight: 1.6,
                      color: 'text.secondary',
                      letterSpacing: '0.01em'
                    }}
                  >
                    {feature.description}
                  </Typography>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>

      {/* Call to Action Section */}
      <Box
        sx={{
          bgcolor: 'secondary.main',
          py: 12
        }}
      >
        <Container maxWidth="md">
          <Box sx={{ 
            textAlign: 'center',
            maxWidth: '600px',
            margin: '0 auto'
          }}>
            <Typography
              variant="h3"
              sx={{
                mb: 3,
                fontSize: { xs: '1.75rem', sm: '2rem', md: '2.25rem' },
                fontWeight: 500,
                letterSpacing: '-0.01em',
                color: 'text.primary'
              }}
            >
              Ready to get started?
            </Typography>
            <Typography
              variant="body1"
              sx={{
                mb: 4,
                fontSize: '1.125rem',
                lineHeight: 1.6,
                color: 'text.secondary',
                letterSpacing: '0.01em'
              }}
            >
              Join Tempo today and transform your study routine with intelligent scheduling.
            </Typography>
            <Button
              variant="contained"
              color="primary"
              size="large"
              onClick={() => navigate('/register')}
              sx={{
                px: 4,
                py: 1.5,
                fontSize: '1rem',
                letterSpacing: '0.02em',
                fontWeight: 500
              }}
            >
              Start Now
            </Button>
          </Box>
        </Container>
      </Box>
    </Box>
  );
}

export default Home;
